import React, { useState } from "react";

const Inputs = (props) => {

	const [ checked, setChecked ] = useState(null)

	const inputdisabled = (e) => {
		setChecked(true)
	}

	return (
		<div>
			<p>Texto del input</p>
			<label htmlFor={props.id}>Input de prueba</label>
			<input
			onFocus={inputdisabled} 
			type="checkbox" 
			/>
			<input 
			className={props.clName} 
			type="text" 
			id={props.id} 
			name={props.name}/>

		</div>
	);
};

export default Inputs;
